import styled from 'styled-components';
import { FormControl, FormLabel, Input, Button, VisuallyHidden } from '@chakra-ui/react';
import { Link } from 'react-router-dom';
import { Search2Icon } from '@chakra-ui/icons';

const Gnb = () => {
  return (
    <GnbWrap>
      <ul>
        <li className="active">
          <Link to="/Exchange">거래소</Link>
        </li>
        <li>
          <Link to="/Deposit">입출금</Link>
        </li>
        <li>
          <Link to="/Investment">투자내역</Link>
        </li>
        <li>
          <Link to="/Help">고객센터</Link>
        </li>
      </ul>
    </GnbWrap>
  );
};

const GnbWrap = styled.nav`
  margin-left: 1.2rem;
  ul {
    display: flex;
    li {
      &.active {
        a {
          font-weight: 500;
          color: var(--white);
          &::after {
            content: '';
            position: absolute;
            bottom: 0;
            left: 0;
            width: 100%;
            height: 2px;
            background: var(--white);
          }
        }
      }
      a {
        position: relative;
        display: flex;
        align-items: center;
        height: var(--header-height);
        padding: 0 0.7rem;
        font-size: 1rem;
        color: var(--S_Light);
        &:hover {
          color: #ccc;
        }
      }
    }
  }
`;

export default Gnb;
